                    { 29, 10, null, null, null, null, null, "r29.docx", "5171413e-2f22-45ab-b750-27c3e59674e4", null, "edorsey9@hc360.com", true, null, null, null, "Nghiên cứu viên UX có kinh nghiệm với lịch sử trong lĩnh vực tương tác người-máy. Có kinh nghiệm trong phương pháp nghiên cứu chất lượng và lượng, bao gồm phỏng vấn người dùng, khảo sát và kiểm tra tính khả dụng. Thạo việc tổng hợp các kết quả nghiên cứu để hỗ trợ quyết định thiết kế và cải thiện trải nghiệm người dùng.", true, false, null, null, null, "$2a$04$n30zXjTuTTbmcuN9cA6I.eblO8E4/JL1p9OIKzgkiu7MGAAGyB4Ya", null, false, "i29.png", null, null, (short)1, true, "Emmet Dorsey" },
                    { 30, 4, null, null, null, null, null, "r30.pdf", "e284fd97-b4e2-44f3-8374-6fd67a47c0ca", null, "cgoldsberrya@shareasale.com", false, null, null, null, "Nhà nghiên cứu UX chuyên về phân tích hành vi người dùng và đồng hành. Thạo việc thu thập và phân tích dữ liệu người dùng để xác định các vấn đề và cơ hội cải thiện. Có kinh nghiệm trong việc làm việc cùng các nhóm chức năng khác nhau để chuyển đổi những hiểu biết nghiên cứu thành các đề xuất thiết kế hành động.", false, false, null, null, null, "$2a$04$IXQDrcm52R..rKAOy0WTP.IXQVPdpS5y5YS/thyvNdXPoQ0lH7dZ6", null, false, "i30.png", null, null, (short)1, false, "Cahra Goldsberry" },
                    { 31, 10, null, null, "Multiple Infractions", null, null, "r31.pdf", "46ee3c80-ad97-4957-9d14-41fd1c0810ce", null, "pwulfingerb@posterous.com", true, new DateTime(2023, 6, 17, 9, 35, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX có chuyên môn về tâm lý học hành vi con người. Có kinh nghiệm trong việc tiến hành các nghiên cứu người dùng, đánh giá tiêu chuẩn và kiểm tra hành trình tư duy. Thạo việc áp dụng các nguyên lý tâm lý học vào việc thiết kế giao diện người dùng.", true, true, null, null, null, "$2a$04$hH/0kPq.q9I9KsD/lmHE9eJQ.D2QsDu2v.15O7vRxWiiTL8cHLxe2", null, false, "i31.png", null, null, (short)0, true, "Paulette Wulfinger" },
                    { 32, 10, null, null, null, null, null, "r32.pdf", "ba7438bf-e202-4fb7-b24c-b8048380eaa8", null, "ewesgatec@china.com.cn", true, null, null, null, "Nhà nghiên cứu UX với sự chú trọng vào khả năng tiếp cận và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về tiếp cận.", true, true, null, null, null, "$2a$04$lx0OqGz.N4PNpbXT18LQI.LIRw03DGzpNWet/nlAJwjCdaD6nphoi", null, true, "i32.png", null, null, (short)1, true, "Eberto Wesgate" },
                    { 33, 2, null, null, null, null, null, "r33.pdf", "224ebdc5-f5e7-4eac-a491-763492df9e12", null, "jfaircleyd@upenn.edu", false, null, null, null, "Nhà nghiên cứu UX chuyên về nghiên cứu dân số và phân loại người dùng. Thạo việc xác định các nhân vật người dùng, tiến hành phân tích cạnh tranh và thu thập thông tin thị trường để hỗ trợ chiến lược sản phẩm. Có kinh nghiệm trong việc áp dụng các phương pháp dựa trên dữ liệu để tối ưu hóa trải nghiệm người dùng.", false, false, null, null, null, "$2a$04$nm9YQ1icfNU4CizCPQonmehLkZZmv6E2OLXIz2z/kXQqgbSyfC0cq", null, true, "i33.png", null, null, (short)1, true, "Jacky Faircley" },
                    { 34, 6, null, null, "Account sharing or impersonation", null, null, "r34.pdf", "083b9616-49af-481e-9d44-92b8401ad342", null, "bcatleye@wikispaces.com", true, new DateTime(2023, 9, 14, 20, 13, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX với sự chuyên sâu trong phân tích nghiên cứu dân tộc và kiểm tra ngữ cảnh. Thạo việc tiến hành các nghiên cứu trường học và quan sát để hiểu hành vi người dùng trong môi trường thực tế. Có kinh nghiệm trong việc chuyển đổi những hiểu biết về dân tộc thành cơ hội thiết kế cho các sản phẩm và dịch vụ số.", true, false, null, null, null, "$2a$04$j6twwudj2WPEO76NUsqDdOBew7PO4Rc7BpFiwbGVq48tvXq6PTegi", null, false, "i34.png", null, null, (short)0, true, "Bertie Catley" },
                    { 35, 7, null, null, null, null, null, "r35.pdf", "2cdc12cd-ef92-48e6-aaa5-1f1d38f9a390", null, "esaylorf@last.fm", false, null, null, null, "Nhà nghiên cứu UX với sự chuyên sâu về an toàn và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về an toàn.", true, false, null, null, null, "$2a$04$XZTxljewq5F7en46SZj9R.y8Z7wz0dHdrdGAG2NO36WR3sCo6PrMG", null, true, "i35.png", null, null, (short)1, true, "Evelina Saylor" },
                    { 36, 3, null, null, "Violation of copyright or intellectual property rights", null, null, "r36.pdf", "b4a560fc-effc-401b-b5e9-f6b0a3d0b935", null, "cfitzackerleyg@miitbeian.gov.cn", false, new DateTime(2023, 1, 15, 21, 42, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX mới bắt đầu nhiệt huyết với sự học hỏi và đóng góp cho các dự án nghiên cứu. Thạo việc tiến hành phỏng vấn người dùng, kiểm tra tính khả dụng và khảo sát để thu thập phản hồi và hiểu biết từ người dùng. Hăng hái hợp tác với các nhà nghiên cứu kinh nghiệm để cải thiện chức năng và trải nghiệm của sản phẩm.", true, true, null, null, null, "$2a$04$pBof1tLNUgaAQRbOm7ENmeuZoJr96dn1PLtpsgrveEdHXCG0buKy2", null, true, "i36.png", null, null, (short)0, false, "Chas Fitzackerley" },
