                    { 41, 10, null, null, null, null, null, "r41.pdf", "1b70d471-1f8d-471f-b612-e72f6313c6f6", null, "eewensonl@google.com.hk", false, null, null, null, "Kỹ sư Machine Learning chuyên sâu về thị giác máy tính và xử lý ảnh. Có kinh nghiệm trong việc xây dựng các hệ thống nhận diện khuôn mặt, phát hiện vật thể và phân tích hình ảnh y tế. Sẵn lòng tìm hiểu và thử nghiệm các phương pháp mới để cải thiện hiệu suất của các ứng dụng.", false, true, null, null, null, "$2a$04$pYXTTsJ8GeRmnUP2DZHwWuUUruSwAEm2aonwARv.O7dDgPa9PGeq6", null, false, "i41.png", null, null, (short)1, false, "Elnar Ewenson" },
