                    { 47, 10, null, null, null, null, null, "r47.pdf", "bc7c207e-9439-4652-8396-09797402ff53", null, "wglanertr@technorati.com", true, null, null, null, "Kỹ sư Machine Learning mới vào nghề, đầy nhiệt huyết và sẵn lòng học hỏi. Có kiến thức cơ bản về các thuật toán học máy và kinh nghiệm trong việc xử lý dữ liệu. Năng động và hợp tác trong môi trường làm việc nhóm.", true, false, null, null, null, "$2a$04$yimp1eJifnBgzhTPro9D9uKItP14jP5HRPZpPsL/36WCz7phoRCUW", null, false, "i47.png", null, null, (short)1, true, "Winna Glanert" },
