                    { 49, 7, null, null, null, null, null, "r49.pdf", "50841cfd-0e51-4103-8315-eadef6ed711d", null, "sgrealisht@netvibes.com", false, null, null, null, "là một Project Manager có kinh nghiệm với niềm đam mê đưa sự hòa hợp vào mỗi dự án mà cô đảm nhận. Với lý lịch trong lĩnh vực kỹ thuật phần mềm, cô liên kết một cách trơn tru sự chuyên môn kỹ thuật với kỹ năng quản lý dự án. Sự bình tĩnh và kỹ năng giao tiếp mạnh mẽ của Namita khiến cô trở thành một nhà lãnh đạo tự nhiên, tài ba trong việc chỉ đạo đội ngũ đạt được kết quả dự án thành công. Sự yêu thích của Namita với âm nhạc và vũ điệu cổ điển Ấn Độ phản ánh qua cách tiếp cận quản lý dự án của cô, nơi cô điều phối các nhiệm vụ một cách chính xác và tinh tế, đảm bảo mọi khía cạnh của dự án diễn ra một cách hoàn hảo", false, true, null, null, null, "$2a$04$lVRSYIkuZsasAcJPy1FsyOitl6HybOG5rqT6jzZ.aRwp/EgmrLNI.", null, false, "i49.png", null, null, (short)1, true, "Salomi Grealish" }
