                values: new object[,]
                {
                    { 50, 7, null, null, null, null, null, "r50.pdf", "d77e5cba-8cc2-4680-88fd-e46e2a370554", null, "vantoniuttiu@smugmug.com", true, null, null, null, "là một Project Manager năng động nổi tiếng với tư duy chiến lược và kế hoạch tỉ mỉ. Với lý lịch trong quản trị kinh doanh kết hợp với kinh nghiệm trong quản lý dự án, anh có góc nhìn độc đáo trong việc xử lý các dự án phức tạp. Phong cách lãnh đạo của Rajesh được đặc trưng bởi khả năng truyền cảm hứng và khích lệ các thành viên trong đội làm việc của anh để đạt được tối đa hiệu quả làm việc của họ. Lấy cảm hứng từ văn học và triết học cổ điển Ấn Độ, Rajesh tiếp cận quản lý dự án với tư duy toàn diện, luôn xem xét tầm nhìn toàn diện và hậu quả dài hạn của quyết định của mình", false, false, null, null, null, "$2a$04$JLiq0tTWaA6IJjXw1VdCq.2L2nqZwnICsp8RNPPCEMDqD/CYhe9UK", null, true, "i50.png", null, null, (short)1, false, "Vale Antoniutti" },
                    { 51, 6, null, null, null, null, null, "r51.pdf", "c7571b2d-6014-4cf4-a0d2-7e39ff29e9c3", null, "sdellv@sakura.ne.jp", false, null, null, null, "Alok là một Project Manager chuyên nghiệp nổi tiếng với cam kết kiên định đối với việc đạt được kết quả. Với lý lịch trong kỹ thuật cơ khí, anh có ánh mắt tinh tế và phương pháp giải quyết vấn đề một cách hệ thống. Phong cách lãnh đạo của Alok được đặc trưng bởi khả năng giữ bình tĩnh dưới áp lực và khả năng tìm ra các giải pháp hiệu quả cho những thách thức phức tạp. Lấy cảm hứng từ các triết lý cổ điển Ấn Độ, Alok tin rằng việc tự phản ánh và liên tục cải tiến là quan trọng, luôn cố gắng hoàn thiện kỹ năng quản lý dự án của mình và dẫn dắt đội ngũ của mình đến sự xuất sắc.", true, true, null, null, null, "$2a$04$qxZ0IO6WgnYGcXemkruc4uxe68Yb18G9HuxlstWmridNvTu0Ba2QC", null, false, "i51.png", null, null, (short)1, true, "Stanley Dell Casa" },
                    { 52, 5, null, null, "Creating multiple accounts to evade bans or restrictions (ban evasion)", null, null, "r52.pdf", "ed4aa254-7eb4-4c08-917b-073a4be996d0", null, "rmcillroyw@amazon.de", true, new DateTime(2023, 8, 31, 14, 38, 0, 0, DateTimeKind.Unspecified), null, null, "Neha là một Project Manager thông minh với sự linh hoạt và sự kiên nhẫn trong việc vượt qua môi trường dự án phức tạp. Với lý lịch trong công nghệ thông tin, cô giỏi sử dụng công nghệ để tối ưu hóa quy trình dự án và tăng cường hiệu suất làm việc. Phong cách lãnh đạo của Neha được đặc trưng bởi khả năng dễ dàng điều hành trong điều kiện không rõ ràng và tìm ra các giải pháp sáng tạo cho những thách thức mới nảy sinh. Lấy cảm hứng từ thần thoại Ấn Độ, Neha tiếp cận quản lý dự án với tinh thần kiên định và kiên nhẫn, tin rằng mọi trở ngại đều là cơ hội cho sự phát triển và học hỏi.", true, false, null, null, null, "$2a$04$2oO0.6Uv1ckhAZcOb8z4culCXZMy.piQcekvAvj/4enurWQ9ICgWK", null, false, "i52.png", null, null, (short)0, false, "Ronald McIllroy" },
                    { 53, 7, null, null, "Engaging in unauthorized commercial activities or scams", null, null, "r53.pdf", "588e0b7e-ac78-457b-b548-db178bc88da7", null, "ktremouletx@tripod.com", true, new DateTime(2023, 9, 2, 22, 23, 0, 0, DateTimeKind.Unspecified), null, null, "Arjun là một Project Manager hấp dẫn với tài năng xây dựng mối quan hệ mạnh mẽ và thúc đẩy sự hợp tác. Với lý lịch trong kỹ thuật xây dựng, anh mang đến một cách tiếp cận có cấu trúc và hệ thống cho các dự án của mình, đảm bảo mọi chi tiết được lập kế hoạch và thực hiện một cách tỉ mỉ. Phong cách lãnh đạo của Arjun được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ nguyên lý karma và dharma, Arjun tiếp cận quản lý dự án với tinh thần mục đích và trách nhiệm, luôn cố gắng tạo ra kết quả tích cực cho cả đội và các bên liên quan.", true, false, null, null, null, "$2a$04$Ua4kw.SZzryF0Ik6MT25d.5liMa2ymjQMp9JkLzagNoyJ0u8tn6P2", null, true, "i53.png", null, null, (short)0, false, "Kelley Tremoulet" },
                    { 54, 2, null, null, "Violating terms of service or user agreement", null, null, "r54.pdf", "58901ab9-6695-4ba4-a6d1-b72db743d667", null, "sdunkersleyy@tuttocitta.it", false, new DateTime(2023, 8, 18, 14, 15, 0, 0, DateTimeKind.Unspecified), null, null, "Ananya là một Project Manager chiến lược nổi tiếng với khả năng phân tích tinh tế và cách tiếp cận tiên tiến. Với lý lịch trong tài chính, cô có hiểu biết sâu sắc về các nguyên tắc kinh doanh và động lực thị trường, mà cô sử dụng để thúc đẩy thành công của dự án. Phong cách lãnh đạo của Ananya được đặc trưng bởi khả năng dự đoán các thách thức tiềm ẩn và tích cực giảm thiểu rủi ro, đảm bảo việc thực hiện dự án diễn ra một cách trơn tru. Lấy cảm hứng từ khái niệm 'jugaad' trong văn hóa Ấn Độ, Ananya hưởng ứng tư duy tiết kiệm và sáng tạo, luôn tìm kiếm các giải pháp sáng tạo để tối ưu hóa tài nguyên và tối đa hóa kết quả của dự án.", true, true, null, null, null, "$2a$04$w8fvqa9FwMX3X5byuleHROC8cyrkKlovsnj0wP2.3gqtngkxei15m", null, true, "i54.png", null, null, (short)0, true, "Sheffy Dunkersley" },
                    { 55, 10, null, null, null, null, null, "r55.pdf", "027049d1-c381-4f45-86be-b4b4f2340361", null, "jyanceyz@redcross.org", false, null, null, null, "Vikram là một Project Manager tầm nhìn với khả năng tưởng tượng và thực hiện các dự án phức tạp một cách chính xác. Với lý lịch trong kiến trúc, anh mang đến một kết hợp độc đáo giữa sự sáng tạo và chuyên môn kỹ thuật cho công việc của mình. Phong cách lãnh đạo của Vikram được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ di sản kiến trúc phong phú của Ấn Độ, Vikram tiếp cận quản lý dự án như một hình thức biểu đạt sáng tạo, luôn thách thức giới hạn của sự đổi mới để mang lại kết quả ấn tượng.", false, false, null, null, null, "$2a$04$jf6Rqk83qj1yl409cxuhreyUG1c1nUwnwYOVRxs1NWDZs6SKwtGGy", null, true, "i55.png", null, null, (short)1, true, "Janifer Yancey" },
                    { 56, 8, null, null, null, null, null, "r56.pdf", "03a9b6f5-d085-4ac0-a2c0-91144c9c883b", null, "meble10@blog.com", true, null, null, null, " Tôi là một lập trình viên Full-Stack đến từ Bắc Kinh, Trung Quốc. Tôi đam mê việc lập trình và tận tâm với công việc của mình. Tôi có kinh nghiệm và kiến thức sâu rộng về cả phía Front-end và Back-end. JavaScript, React và Node.js là những công cụ tôi thường xuyên sử dụng để xây dựng ứng dụng web động và hiệu quả.", false, true, null, null, null, "$2a$04$mska6go1xMbwmnr.70jfM.iEagWviKq4inOQaGtcgEWwq1AJxQRJq", null, false, "i56.png", null, null, (short)1, false, "Marlene Eble" },
