                    { 65, 2, null, null, "Continuously disrupting community events or discussions", null, null, "r65.docx", "bd10e0ad-7a70-48b4-82da-43a833c65c13", null, "iewington19@tamu.edu", false, new DateTime(2023, 7, 22, 1, 33, 0, 0, DateTimeKind.Unspecified), null, null, "Claire, with a degree in fine arts or graphic design, has a talent for creating visually stunning game worlds and characters. Her creativity knows no bounds as she crafts breathtaking landscapes, intricate character designs, and captivating animations that bring games to life.", true, false, null, null, null, "$2a$04$8h6SDxbdE1x65GFfC48uBOEadXN0mKucOXrKmHzHUf1MtvsRv2a7S", null, false, "", null, null, (short)0, false, "Igor Ewington Claire" },
                    { 66, 9, null, null, null, null, null, "r66.docx", "771c2262-a2ea-4c76-82c7-787b3c614793", null, "hangerstein1a@godaddy.com", true, null, null, null, "Tôi là một Backend Developer với 5 năm kinh nghiệm trong ngành công nghệ thông tin. Trình độ chuyên môn của tôi tập trung vào lập trình Java và Python, cùng với các kỹ năng vững về xử lý dữ liệu và tối ưu hóa hiệu suất. Tôi đã tham gia vào nhiều dự án lớn, từ các ứng dụng web đến các hệ thống quản lý cơ sở dữ liệu phức tạp. Sự kiên nhẫn và ham học hỏi là những điểm mạnh của tôi, và tôi luôn mong muốn thách thức bản thân để phát triển mỗi ngày.", false, false, null, null, null, "$2a$04$7ZK8ncz5okb46SXMi2aX/OFn9uu1KmEedijLd68QYqC5vfb82w2Me", null, false, "i66.png", null, null, (short)1, true, "Holmes Angerstein" },
